import React from "react";
const Navbar = () => {
  return (
    <React.Fragment>
      <div className="ui secondary stackable fixed menu navbar-background">
        <div className="left menu h1-navbar">
          <h1>VOLTRA</h1>
        </div>
        <div className="right menu a-navbar">
          <a className="item">Our-Story</a>
          <a className="item">Modal</a>
          <a className="item">FAQ</a>
          <a className="item">Contact</a>
        </div>
      </div>
    </React.Fragment>
  );
};

export default Navbar;
